import React from "react";
import { useState } from "react";

function DataLoad() {
  key = "2P@ghtU#SzbkNYKP2jZpXsp54@1D66DK";
  axios.get(
    "http://www.career.go.kr/inspct/openapi/test/questions?apikey=%7B개인인증키%7D&q=6%27"
  );
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>직업 가치관 검사</p>
      </header>
      <label>
        {" "}
        이름:
        <input type="text" name="name" />
      </label>
      <br />
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="react"
          // checked={this.state.radioGroup["react"]}
          // onChange={this.handleRadio}
        />
        여자
      </label>
      <br />
      <label>
        <input
          type="radio"
          name="radioGroup"
          value="polymer"
          // checked={this.state.radioGroup["polymer"]}
          // onChange={this.handleRadio}
        />
        남자
      </label>
      <br />
      <button onclick="activateLasers()">검사시작</button>
    </div>
  );
}

export default App;
